import React from 'react';

import './collectionPreview.styles.scss';

const CollectionPreview = ({ title, items }) => (
    <div>
        <h2>{ title }</h2>
        <div>
            {items.filter((item, index) => index < 4)
                  .map(item => (
                <div key={item.id}>{item.name}</div>
            ))}
        </div>
    </div>
)

export default CollectionPreview;
